import React, {Component} from 'react'


class BadRobot extends Component {

    convertInput = (userInput) =>{
        let l = userInput.split(" ").map(value => value = "BLABL")
        return l
    }
    render(){
        return(
            <div>
                <h1>Bad Robot</h1>
            </div>
        )
    }
}
export default BadRobot
